import React, { useEffect, useState } from 'react';
import Button from 'react-bootstrap/Button';
import Navbar from '../navSection/Navbar';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import { Link, useNavigate } from 'react-router-dom';
import Footer from '../footerSection/Footer';
import axios from 'axios';
import HttpsIcon from '@mui/icons-material/Https';
import { useDispatch, useSelector } from 'react-redux';
import { fetchSuccess } from '../redux/userSlice';
import Error from '../utils/Error';
import { toast } from 'react-toastify';
import { api } from '../utils/apiConfig';

function SignUp() {
  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [firstName, setFirstName] = useState('');
  const [comfirmPassword, setComfirmPassword] = useState('');
  const [country, setCountry] = useState('');
  const [email, setEmail] = useState('');
  const [state, setState] = useState('');
  const [age, setAge] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { userInfo } = useSelector((state) => state.user);
  

  const handleSignUp = async (e) => {
    e.preventDefault();
  if(comfirmPassword.toString() === password.toString()){
    try {
      
      const { data } = await axios.post(
        `${api}/api/users/register`,{ name:name,
        surname:surname,
        firstname:firstName,
        password:password,
        age:age,
        country:country,
        state:state,
        email:email,},
      );
      dispatch(fetchSuccess(data));
    } catch (error) {
      setError(error.response.data.message);
    }
  }else{
    toast.error(error.response.data.message,{autoClose:true, theme: "colored", toastId:"unique-toast-id"});
  }
  };

  useEffect(() => {
    if (userInfo?.user?.name) {
      navigate('/');
    }
  });

  return (
    <div style={{ width: '99vw', backgroundColor:"lightgrey", overflowX:"hidden" }}>
      <Navbar />


      <div
        className="d-flex justify-content-center py-5 flex-column align-items-center"
        style={{ width: '100vw', backgroundColor:"lightgrey", overflowX:"none" }}
      >
        <h4>Welcome!</h4>
        <Button
          variant="success"
          className="bg-success opacity-75 p-1"
          style={{ borderRadius: '50%' }}
        >
         <HttpsIcon/>
        </Button>
        <strong>Sign Up</strong>
        <Form onSubmit={handleSignUp}>
          <InputGroup className="my-3">
            <InputGroup.Text>name</InputGroup.Text>
            <Form.Control
              type="text"
              onChange={(e) => setName(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Surname</InputGroup.Text>
            <Form.Control
              type="text"
              onChange={(e) => setSurname(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>First-Name</InputGroup.Text>
            <Form.Control
              type="text"
              onChange={(e) => setFirstName(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>State</InputGroup.Text>
            <Form.Control
              type="text"
              onChange={(e) => setState(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Country</InputGroup.Text>
            <Form.Control
              type="text"
              onChange={(e) => setCountry(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Age</InputGroup.Text>
            <Form.Control
              type="Date"
              onChange={(e) => setAge(e.target.value)}
            />
          </InputGroup>
          <InputGroup className="my-3">
            <InputGroup.Text>Email</InputGroup.Text>
            <Form.Control
              type="email"
              onChange={(e) => setEmail(e.target.value)}
            />
          </InputGroup>
          <InputGroup  className="my-3">
            <InputGroup.Text>Password</InputGroup.Text>
            <Form.Control
              type="password"
              onChange={(e) => setPassword(e.target.value)}
            />
          </InputGroup>
          <InputGroup  className="my-3">
            <InputGroup.Text>Comfirm Password</InputGroup.Text>
            <Form.Control
              type="password"
              onChange={(e) => setComfirmPassword(e.target.value)}
            />
          </InputGroup>
          <div className="d-grid my-3">
            <Button variant="success" className="bg-success" type="submit">
              Login
            </Button>
          </div>
        </Form>
        <div>
          <strong>
            {' '}
            Have an account ? <Link to="/signin"> sign in here</Link>
          </strong>
        </div>
        {error !== null && <Error error={error} />}
      </div>
      <Footer />
    </div>
  );
}

export default SignUp;
